import logo from './logo.svg';
import './App.css';
import Header from './Components/Header';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faGithub } from '@fortawesome/free-solid-svg-icons'

function App() {
  const element = <FontAwesomeIcon icon={faGithub} />
  return (
    <div>
        <Header/>
        <footer>
        <ul style={{display: "flex"}}>
            <li className="mx-5">
              <span role="img" aria-label="github">{element}</span>
            </li>
            <li className="mx-2">
              <h2> Portfolio</h2>
            </li>
            <li className="mx-2">
                <h2> Contact Me</h2>
            </li>
            <li className="mx-2">
                <h2> Resume</h2>
            </li>
         </ul>
        </footer>
    </div>

  );
}

export default App;
